import '../Coin.css'
import {Link} from "react-router-dom";

const Coin = ({name, image, symbol, price }) => {
    return (
        <Link to="/addcoin">
        <div className='coin-container' style={{ cursor: "pointer" }} onClick={() => update(result)}>
            <div className='coin-row'>
                <div className='coin'>  
                    <img src={image} alt='crypto'/>
                    <h1>{name}</h1>
                    <p className='coin-symbol'>{symbol}</p>
                    <div>
                <p className='coin-data'>${price}</p>
                </div> 
                </div>
                
            </div>
        </div>
        </Link>
    );
};

export default Coin;
